INSERT INTO $$EXCEPDB.EX_MT_BKG_SLS_MOTION_ATTRIB SELECT SM.SK_SALES_MOTION_ATTRIB_KEY , CASE WHEN INCR.SALES_ORDER_LINE_KEY= -8888 THEN RANDOM(1005000,1006800)*-1 WHEN INCR.SALES_ORDER_LINE_KEY= -9999 THEN RANDOM(1000000,1001800)*-1 WHEN INCR.SALES_ORDER_LINE_KEY= -7777 THEN RANDOM(1010000,1011800)*-1 WHEN INCR.SALES_ORDER_LINE_KEY=-6666 THEN RANDOM(1015000,1016800)*-1 ELSE INCR.SALES_ORDER_LINE_KEY END SALES_ORDER_LINE_KEY , INCR.BK_POS_TRANSACTION_ID_INT AS DV_TRANSACTION_ID , INCR.DV_TRX_TYPE , INCR.SALES_MOTION_CD , INCR.START_TV_DTM , INCR.END_TV_DTM , INCR.PRODUCT_KEY AS DV_ENTERPRISE_INV_SKU_ID , INCR.DV_ALLOCATION_PCT , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN ITEM_CATEGORY_NAME ELSE INCR.DV_SERVICE_CATEGORY_CD END AS DV_SERVICE_CATEGORY_CD , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN 'Y' ELSE INCR.DV_OA_FLG END AS DV_OA_FLG , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN 'RTNR' ELSE INCR.DV_SOURCE_TYPE END AS DV_SOURCE_TYPE , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN NATTR.BK_AS_ARCHITECTURE_NAME ELSE 'UNKNOWN' END AS AS_ARCHITECTURE_NAME , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN NATTR.BK_TECH_GROUP_ID ELSE 'UNKNOWN' END AS TECHNOLOGY_GROUP_ID , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN NATTR.BK_DV_ATTR_PRDT_OFFER_TYPE_NAME ELSE 'UNKNOWN' END AS ATTR_PRDT_OFFER_TYPE_NAME , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN NATTR.AS_TS_CD ELSE 'UNK' END AS AS_TS_CODE , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN NATTR.SK_RENEW_CONTRACT_LINE_ID ELSE -999 END AS SK_RENEW_CONTRACT_LINE_ID , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN NATTR.SK_AS_PARENT_INVENTORY_ITEM_ID ELSE -999 END AS SK_AS_PARENT_INVENTORY_ITEM_ID , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN NATTR.SK_ATTRIBUTION_ID_INT ELSE INCR.SK_OFFER_ATTRIBUTION_ID_INT END AS SK_OFFER_ATTRIBUTION_ID_INT ,USER AS EDW_UPDATE_USER ,CURRENT_TIMESTAMP(0) AS EDW_CREATE_DTM ,CURRENT_TIMESTAMP(0) AS EDW_UPDATE_DTM ,USER AS EDW_CREATE_USER ,COALESCE(CASE WHEN NSOL.SALES_ORDER_KEY= -8888 THEN RANDOM(1005000,1006800)*-1 WHEN NSOL.SALES_ORDER_KEY= -9999 THEN RANDOM(1000000,1001800)*-1 WHEN NSOL.SALES_ORDER_KEY= -7777 THEN RANDOM(1010000,1011800)*-1 WHEN NSOL.SALES_ORDER_KEY=-6666 THEN RANDOM(1015000,1016800)*-1 ELSE NSOL.SALES_ORDER_KEY END, RANDOM(1010000,1011800)*-1) AS SALES_ORDER_KEY ,CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN NATTR.ATTR_PRDT_KEY ELSE INCR.PRODUCT_KEY END AS SRC_ENTERPRISE_INV_SKU_ID , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN NATTR.ATTR_PRDT_CLASS_NAME ELSE 'UNKNOWN' END AS PRODUCT_CLASS , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN NATTR.TRANSACTION_CR_PARTY_KEY ELSE -999 END AS TRANSACTION_CR_PARTY_KEY , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN NATTR.HQ_CR_PRTY_KEY ELSE -999 END AS HQ_CR_PRTY_KEY , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN NATTR.RENEWAL_REF_ID ELSE 'UNKNOWN' END AS RENEWAL_REF_ID , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN NATTR.RENEWAL_REF_CD ELSE 'UNKNOWN' END AS RENEWAL_REF_CD , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN NATTR.SMR_TAGGING_FAILURE_RSN_CD ELSE INCR.SLS_MTN_CORRECTION_REASON_DESC END AS SMR_TAGGING_FAILURE_RSN_CD , CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN NATTR.SALES_MOTION_TIMING_CD ELSE INCR.SALES_MOTION_TIMING_CD END AS SALES_MOTION_TIMING_CD /*dbommise added below columns as part of Q3FY20 March release */ , INCR.MANUAL_OVERRIDE_ROLE , INCR.REQUESTING_CSCO_WRKR_PRTY_KEY , INCR.SLS_MTN_CORRECTION_CASE_NUM , INCR.SLS_MTN_CORRECTION_CMNT ,CASE WHEN NATTR.POS_TRANSACTION_ID_INT IS NOT NULL THEN NATTR.DV_RENEWAL_GAP_DAYS_CNT ELSE -9999 END AS RENEWAL_GAP_DAYS ,'N' AS BUNDLE_FLG FROM $$STGDB.WI_N_POS_TRX_LN_NEW_RENEW_INCR INCR INNER JOIN $$ETLVWDB.SM_BKG_SLS_MOTION_ATTRIBUTION SM ON INCR.BK_POS_TRANSACTION_ID_INT = SM.DV_TRANSACTION_ID AND INCR.DV_TRX_TYPE = SM.DV_TRX_TYPE AND INCR.PRODUCT_KEY = SM.DV_ENTERPRISE_INV_SKU_ID AND INCR.SK_OFFER_ATTRIBUTION_ID_INT=SM.SK_OFFER_ATTRIBUTION_ID_INT
INNER JOIN $$SLSORDVWDB.N_SALES_ORDER_LINE_TV NSOL ON INCR.SALES_ORDER_LINE_KEY = NSOL.SALES_ORDER_LINE_KEY AND CAST(NSOL.END_TV_DATETIME AS DATE) = CAST( '3500-01-01' AS DATE) AND NSOL.SS_CODE IN ('CG','OPL')
